import { useState } from "react";
import { FaRegCalendarAlt, FaRegHeart, FaBell, FaSignOutAlt } from "react-icons/fa";
import { Card, CardContent } from "@/components/ui/card";
import { Button } from "@/components/ui/button";

export default function Dashboard() {
  const [activeTab, setActiveTab] = useState("tracker");

  return (
    <div className="flex h-screen bg-gray-100">
      {/* Sidebar */}
      <aside className="w-64 bg-blue-900 text-white p-6">
        <h2 className="text-lg font-semibold mb-4">CycleCare Dashboard</h2>
        <nav>
          <ul className="space-y-4">
            <li className={`p-2 rounded-lg ${activeTab === "tracker" ? "bg-blue-700" : ""}`} onClick={() => setActiveTab("tracker")}>Tracker</li>
            <li className="p-2 rounded-lg">Mood Tracker</li>
            <li className="p-2 rounded-lg">Health Tips</li>
            <li className="p-2 rounded-lg">Reminders</li>
          </ul>
        </nav>
      </aside>
      
      {/* Main Content */}
      <main className="flex-1 p-10 bg-white">
        <header className="flex justify-between items-center border-b pb-4">
          <h1 className="text-2xl font-bold">Welcome to Your Menstrual Tracker</h1>
          <Button className="bg-red-500 text-white px-4 py-2 rounded-lg flex items-center"><FaSignOutAlt className="mr-2" /> Logout</Button>
        </header>

        <div className="grid grid-cols-2 gap-4 my-6">
          <Card>
            <CardContent>
              <h3 className="text-xl font-semibold">Next Predicted Period</h3>
              <p className="text-lg">March 15, 2025</p>
            </CardContent>
          </Card>
          <Card>
            <CardContent>
              <h3 className="text-xl font-semibold">Current Phase</h3>
              <p className="text-lg">Follicular</p>
            </CardContent>
          </Card>
        </div>

        {/* Tabs */}
        <div className="flex space-x-6 border-b pb-2">
          <span className={`cursor-pointer ${activeTab === "tracker" ? "border-b-2 border-blue-500" : ""}`} onClick={() => setActiveTab("tracker")}>Tracker</span>
          <span className="cursor-pointer">Mood Tracker</span>
          <span className="cursor-pointer">Health Tips</span>
          <span className="cursor-pointer">Reminders</span>
        </div>

        {/* Content Cards */}
        <div className="grid grid-cols-2 gap-6 mt-6">
          <Card>
            <CardContent>
              <h3 className="text-xl font-semibold">Track Your Cycle</h3>
              <p>Monitor your cycle length, predict your next period, and get insights.</p>
              <Button className="bg-blue-500 text-white px-4 py-2 mt-2">Learn More</Button>
            </CardContent>
          </Card>
          <Card>
            <CardContent>
              <h3 className="text-xl font-semibold">Track Your Mood</h3>
              <p>Log your mood daily to identify patterns and improve mental health.</p>
              <Button className="bg-blue-500 text-white px-4 py-2 mt-2">Log Mood</Button>
            </CardContent>
          </Card>
        </div>
      </main>
    </div>
  );
}



